import React from "react";

function Cards() {
    console.log(props);
    return (
        <>
            <div className="cards">
                <div className="card">
                    <div className="image">
                        <img src={props.images} alt="Images" />
                    </div>
                    <span>{props.title}</span>
                    <div>{props.type}</div>
                </div>
            </div>
        </>
    )
};

export default Card;
